import React , {useEffect, useState} from "react";
import {  Link , useParams } from "react-router-dom";
import axios from "axios";
import "../styles/mainPageAdmin.css";

function Mainpage_Admin(){

    const {id} = useParams();

  const [info , setInfo]=useState({
     Title_Quiz:"" , arrdata :[]
  });

   
  const [user , setUser]=useState({
    email:"" , pass:"" , name:""
});

  
  function Load(){
    
    axios.get("/get_Quiz/"+id)
    .then((res)=> {
       console.log(res);
      setInfo({
        arrdata : res.data
      })
    })
    .catch((err)=>{
        console.log(err); 
      })



      axios.get("/get_specific_admin/"+id)

        .then((res)=>{
            console.log(res);
            setUser(res.data);

        })
        .catch((err)=>{
            console.log(err);
        })
}

    useEffect(()=>{
      Load();
    }, []
  )


   
    





    return(



        <>
        
        <div>
      


  <nav class="navbar navbar-expand-lg navbar-light fixed-top">
		<div class="container">
		 <b> Welcome {user.email}</b> 
	   <div class="collapse navbar-collapse" id="navbarSupportedContent">
                
				<ul class="navbar-nav ml-auto">
					
					  <li class="nav-item">					
              <Link to={"/create_quiz/"+id}>
                <button  className="header btn btn-primary"> Create Quiz</button>
              </Link>                      
					  </li>
      		  <li>		
              <Link to={"/all_quiz/"+id}>
                 <button  className="header btn btn-primary">View My Quizs</button>
              </Link>
      			</li>
		
             <li>
               <Link to={"/Admin_Profile/"+id}>
                  <button  className="btn btn-primary" id="update-but">Update Profile</button>
               </Link>
             </li>
             
             <li class="nav-item">
                <Link to={"/adminlogin"}>
                   <button  className="header btn btn-primary"> LogOut</button>
                </Link>            
					   </li>

				</ul>
			</div>
		</div>
	</nav>
	</div>
      
        </>
    )

}
export default Mainpage_Admin;
